import React from "react";
import "./App.css";
import { BrowserRouter as Router, Route, Switch, Redirect } from "react-router-dom";
import { Navigation, Footer, Home} from "./components";
import Proportion from "./Proportion.js"
import AnswerTime from "./AnswerTime.js"
//You have to use the link component to link between you pages 
import { Link } from "react-router-dom";

const MainPage = () => {
  return (
    <div>
      <h3>Welcome to the React Router Tutorial</h3>
      <small>Main Page</small>
      <Link to="/AnswerTime">Show List of Times</Link>
    </div>
  );
};

function old() {
  return (
    <div className="App">
      <Router>
        <Navigation />
        <Switch>
                  <Route exact path="/" component={MainPage} />
        </Switch>
      </Router>
    </div>
  );
}

//export default App;


class App extends React.Component {
  render() {
    return (
      <Router>
       {/*All our Routes goes here!*/}
       <Route path="/" component={MainPage} />
<Route path="./AnswerTime.js" component={AnswerTime} />
      </Router>
    );
  }
}

export default App;
